  return (
    <Header>
      <Header.Inner>
        <Header.Logo
          src={"/images/icons/logo.svg"}
          alt="Nerflix"
          to={ROUTES.HOME}
        />
      </Header.Inner>
      {children}
    </Header>
  )
}
